export function Login_loading({text}){
    var p={
        position:'absolute',
        bottom:'-10px',
        fontSize:'small',

        color:'rgb(10,30,10)'
    }

    return(

            <div className={'container'}>

                <div style={{marginBottom:'20px'}} className={'loader'}>

                </div>
                <p style={p}>{
                    text
                }</p>
            </div>


    )
}
